import img from "./imgs.js";
import imgcard from "./imgcard.js";

function createcard(info)
{
  return(
    <div>
      <imgcard key={info.id} val={info.pic}/>
    </div>
  )
}

function App() {
  return (
    <div >
      {img.map(createcard)}
    </div>
  );
}

export default App;
